The Fixx - One Thing Leads to Another [promo] (2+6 ch Dolby).VOB



HQ rare promo music video with Dolby Digital 6 channel and Stereo audio tracks. The Fixx are an English rock band best known for their song &quot;One Thing Leads to Another&quot;, from their most successful album Reach the Beach in 1983. The band achieved its greatest success in the U.S. and Canada.

The Fixx are recording their 10th studio album &quot;Something Ahead of You&quot; due for release in April 2011.

&quot;One Thing Leads to Another&quot; is a song by new wave rock group The Fixx, from their album Reach the Beach. &quot;One Thing Leads to Another&quot; is the group's best known song, and their most successful single, peaking at No. 4 on the US Billboard Hot 100 chart in November 1983 and peaking at No. 2 on the US Mainstream Rock Tracks chart.

Reach the Beach is the second studio album by British new wave band The Fixx, released in 1983. The album reached number eight on the American albums chart, their highest to date there.

This video begins at a science lab where Adam Woods is looking into a microscope observing a new dimension (the wrist shackle in the video on the wall is seen on the cover of Reach the Beach). It shows a dimension in a black tunnel with lights on top where Cy Curnin is dancing in a classy uniform. He is then in a bright tube, wearing a gray shirt with his arms bare. Then, in a blue tunnel, he is running with a dog. It ends with the tunnel in a 3-dimensional angle to see through out the tube.
